import mobiscroll from "@mobiscroll/react";

class AA extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      myEvents: [],
    };

    mobiscroll.util.getJson(
      "https://trial.mobiscroll.com/events/",
      (events) => {
        this.setState({ myEvents: events });
      },
      "jsonp"
    );
  }
  render() {
    return (
      <mobiscroll.Eventcalendar
        theme="ios"
        themeVariant="light"
        display="inline"
        data={this.state.myEvents}
        view={{
          calendar: { type: "week" },
          eventList: { type: "day", scrollable: true },
        }}
      />
    );
  }
}
export default AA;
